import axios from 'axios';
import './Carouseler.css';
import { useState,useMemo } from 'react';
const Carouseler = () => {
    const [images, setImages] = useState([]);

    const fetchAPI = async()=>{
    const response = await axios.get('https://api.unsplash.com/photos/?client_id=YbnWcUQHyapMRVl5x8yCOn_I9inhl0dTOpCfNjy99no');
    const data = response.data;
    setImages(data);
    }
    useMemo(
      fetchAPI,[]
    )
  return (
    <div>
        <CCarousel controls indicators>
  <CCarouselItem>
    <CImage className="d-block w-100" src={ReactImg} alt="slide 1" />
  </CCarouselItem>
  <CCarouselItem>
    <CImage className="d-block w-100" src={VueImg} alt="slide 2" />
  </CCarouselItem>
  <CCarouselItem>
    <CImage className="d-block w-100" src={AngularImg} alt="slide 3" />
  </CCarouselItem>
</CCarousel>
    </div>
  )
}
export default Carouseler
